import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from "react-router-dom";
import GraphInput from "./components/GraphInput";
import GraphVisualization from "./components/GraphVisualization";
import Algorithms from "./components/Algorithms";
import "./styles/App.css";

function HomePage() {
  return (
    <div className="start-page">
      <header>
        <h1>Website Wireframe</h1>
      </header>
      <div className="main">
        <div className="card">
          <h2>Your Graph Algorithm</h2>
          <Link to="/graph">
            <button className="start-button">Start</button>
          </Link>
        </div>
        <div className="card">
          <h2>Your Data Structure</h2>
          <Link to="/data-structure">
            <button className="start-button">Start</button>
          </Link>
        </div>
      </div>
      <footer>
        <p>Internet of Things</p>
        <p>2025</p>
      </footer>
    </div>
  );
}

function GraphPage({ handleMatrixSubmit, matrix, vertices, resetGraph }) {
  const navigate = useNavigate();

  useEffect(() => {
    // Очищення стану графа при завантаженні сторінки
    resetGraph();
  }, [resetGraph]);

  return (
    <div>
      <header>
        <button className="back-button" onClick={() => navigate(-1)}>
          Back
        </button>
        <h1>Graph Algorithms Visualization</h1>
      </header>
      <GraphInput onMatrixSubmit={handleMatrixSubmit} />
      <GraphVisualization matrix={matrix} vertices={vertices} />
      <Algorithms matrix={matrix} />
    </div>
  );
}

function DataStructurePage() {
  const navigate = useNavigate();

  return (
    <div>
      <header>
        <button className="back-button" onClick={() => navigate(-1)}>
          Back
        </button>
        <h1>Data Structure Visualization</h1>
      </header>
      <p>Data Structure functionality will be here</p>
    </div>
  );
}

function App() {
  const [matrix, setMatrix] = useState([]);
  const [vertices, setVertices] = useState([]);

  const handleMatrixSubmit = (newMatrix) => {
    setMatrix(newMatrix);
    setVertices(generateVertices(newMatrix.length));
  };

  const generateVertices = (count) => {
    const angleStep = (2 * Math.PI) / count;
    const radius = 150;

    return Array.from({ length: count }, (_, i) => ({
      x: 300 + radius * Math.cos(i * angleStep),
      y: 300 + radius * Math.sin(i * angleStep),
    }));
  };

  const resetGraph = () => {
    setMatrix([]);
    setVertices([]);
  };

  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route
          path="/graph"
          element={
            <GraphPage
              handleMatrixSubmit={handleMatrixSubmit}
              matrix={matrix}
              vertices={vertices}
              resetGraph={resetGraph}
            />
          }
        />
        <Route path="/data-structure" element={<DataStructurePage />} />
      </Routes>
    </Router>
  );
}

export default App;
